import React from 'react'
//hooks
import HookUseState from '../../components/HookUseState'
import HookUseReducer from '../../components/HookUseReducer'
import HookUseEffect from '../../components/HookUseEffect'
const Home = () => {
  return (
    <div>
      <HookUseState/>
      <HookUseReducer/>
      <HookUseEffect/>
    </div>
  )
}

export default Home
